function Slogan() {
    return (
        <div className="container">
            <div className="d-flex justify-content-center align-items-center" id="animatedTextBackground" style={{ borderRadius:10, marginBottom: 10, }} >
                <h1 id="animatedTextHeading"><br /><strong>Herkesin içinde doğru olana eğri bakan bir göz vardır.&nbsp;</strong><br /><strong>Mimar Sinan</strong><br /><br /><br /></h1>
            </div>
        </div>
    )
}

export default Slogan
